import AxiosClient from './AxiosClient'


const getToken = (): string => {
    try {
        let token: string
        AxiosClient.post('/auth', { apiKey: "23567b218376f79d9415" })
            .then(response => token = response.data.token)
        return token
    } catch (error) {
        throw Error(error)
    }
}

export default getToken
